import React from 'react'

const Navbar = () => {
    return (
    <div className="container">
    <nav className="navbar fixed-top navbar-dark bg-dark">
        <a className="navbar-brand"><i className="fas fa-code"/> Analytics Dashboard</a>
    </nav>
    </div>    
    )
}

export default Navbar
